  true,\n\t\"url\": null,\n\t\"notes\": \"The wildfire hazard potential (WHP) is a
  raster geospatial product at 270-meter resolution covering all lands in the conterminous
  United States. It can help to inform evaluations of wildfire risk or prioritization
  of fuels management needs across very large landscapes (millions of acres). Our
  specific objective with the WHP map is to depict the relative potential for wildfire
  that would be difficult for suppression resources to contain. For more information,
  please visit: http://www.firelab.org/project/wildfire-hazard-potential.rnrnrnThis
  dataset can be downloaded from this website: http://dx.doi.org/10.2737/RDS-2015-0046\",\n\t\"license_title\":
